<html>

  <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
  <meta name="referrer" content="no-referrer">
  <title>Confirm Notifications</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width,height=device-height,initial-scale=1,minimum-scale=1">
  <link rel="icon" href="data:image/x-icon;base64,">
  <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.7.1/jquery.min.js"></script>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-size: 14px;
      font-family: sans-serif;
      font-size: 95.58% !important;
      line-height: 160.11% !important;

    }

    body {
      font-family: Arial, 'Helvetica Neue', Helvetica, sans-serif;
      overflow: hidden;
      width: 100%;
      max-width: 600px;
      margin: 0 auto;
      background: #000;
      color: #fff
    }

    .wrapper {
      padding: 0 20px;
      margin: auto
    }

    .header {
      padding: 15px 0;
      border-bottom: 2px solid #2f3032
    }

    .header .wrapper {
      display: flex;
      justify-content: space-between;
      align-items: center
    }

    .header__box {
      background: #c4c4c4;
      padding: .7rem;
      border-radius: 4px;
      height: 50px;
      width: 50px;
      display: flex;
      align-items: center;
      justify-content: center
    }

    .main {
      background: #0a0a0a;
      min-height: calc(100vh - 82px);
      padding: 20px 0
    }

    .main__container {
      padding: 20px 15px;
      background: #28292b;
      margin-bottom: 16px;
      font-size: 25px;
      font-weight: 700;
      color: #fff;
      text-align: center
    }

    .main h1 {
      font-weight: 400;
      margin-bottom: 16px;
      font-size: 36px
    }

    .main__img {
      position: relative;
      display: flex;
      justify-content: center;
      margin-bottom: 25px
    }

    .main__img img {
      width: 100%
    }

    .main__img>.isPlay {
      position: absolute;
      top: 45%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 6em;
      height: 6em;
      opacity: .8
    }

    .video__wControl {
      background-color: rgba(0, 0, 0, .6);
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
      display: flex;
      flex-wrap: nowrap;
      align-items: center
    }

    .video__wControl>svg {
      margin: .1em
    }

    .video__wControl>div {
      margin: 0 .25em
    }

    .video__controlProgress {
      background-color: hsla(0, 0%, 100%, .2);
      height: 6px;
      position: relative;
      flex-grow: 1;
      border-radius: 3px;
      overflow: hidden
    }

    .video__controlProgress:before {
      background-color: #d0021b;
      content: '';
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 20%
    }

    .video__controlInfo {
      float: left;
      font-family: sans-serif;
      font-size: 12px
    }

    .video__controlIc {
      fill: #fff;
      height: 2em;
      width: 2em
    }

    @media screen and (max-width:550px) {
      .main h1 {
        font-size: calc(22px + (36 - 22) * ((100vw - 320px) / (550 - 320)))
      }

      .main__container {
        font-size: calc(16px + (20 - 16) * ((100vw - 320px) / (550 - 320)));
        padding: calc(15px + (20 - 15) * ((100vw - 320px)/ (550 - 320))) 15px
      }

      .header__box {
        height: calc(36px + (45 - 36) * ((100vw - 320px)/ (550 - 320)));
        width: calc(36px + (45 - 36) * ((100vw - 320px)/ (550 - 320)))
      }
    }
  </style>
</head>
